-- | This is the subset of the UTxO that ideally would have been deleted at the
-- Byron-to-Shelley transition on Cardano, but instead were deleted at the
-- Shelley-to-Allegra boundary. It was only possible to consume these UTxO
-- during Byron, so they were dead as of the Byron-to-Shelley transition.
deadCardanoAVVM :: Crypto c => UTxO (ShelleyEra c)
deadCardanoAVVM = UTxO $ SplitMap.fromList pairs

txin :: forall c . Crypto c => String -> TxIn c
txin h =
    TxIn (TxId (fromHex h)) (TxIx 0)
  where
    fromHex :: String -> SafeHash c EraIndependentTxBody
    fromHex =
        unsafeMakeSafeHash
      . Data.Maybe.fromMaybe (error "DeadCardanoAVVM txin")
      . hashFromStringAsHex

txout :: (Crypto c) => String -> Integer -> TxOut (ShelleyEra c)
txout h i =
    TxOut
      (C.AddrBootstrap
         (C.BootstrapAddress
            (C.Address {
                C.addrRoot       = fromHex h
              , C.addrAttributes = addrAttrs
              , C.addrType       = C.ATRedeem
              })))
      (Coin i)
  where
    addrAttrs :: C.Attributes C.AddrAttributes
    addrAttrs = C.Attributes {
        C.attrData   = C.AddrAttributes {
            C.aaVKDerivationPath = Nothing
          , C.aaNetworkMagic     = C.NetworkMainOrStage
          }
      , C.attrRemain = C.UnparsedFields mempty
      }

    fromHex :: String -> C.AddressHash C.Address'
    fromHex =
        either (error "DeadCardanoAVVM txout") id
      . decodeAbstractHash   -- name doesn't say it, but it expects hex
      . Text.pack

